import React from 'react';
import { Routes, Route } from 'react-router-dom';
// import LoginContextProvider from './context/LoginContext';
import Login from './pages/Login';
import StockList from './pages/StockList';
import ComprarOuVender from './pages/ComprarOuVender';
import DepositOrWithdrawal from './pages/DepositOrWithdrawal';
import NotFound from './pages/NotFound';
import './App.css';

function App() {
  return (
    // <LoginContextProvider>
    <Routes>
      <Route exact path="/" element={<Login />} />
      <Route path="/home" element={<StockList />} />
      <Route path="/comprarOuVender" element={<ComprarOuVender />} />
      <Route path="/depositOrWithdrawal" element={<DepositOrWithdrawal />} />
      <Route path="*" element={<NotFound />} />
    </Routes>
    // </LoginContextProvider>
  );
}

export default App;
